import './App.css';
import DiaryEditor from './DiaryEditor';
import DiaryList from './DiaryList';

const dumyList = [
  {
    id:1,
    author:"문정욱",
    content:"하이 1",
    emotion:5,
    created_date: new Date().getTime()
  },
  {
    id:2,
    author:"아무개",
    content:"하이 2",
    emotion:5,
    created_date: new Date().getTime()
  },
  {
    id:3,
    author:"킴",
    content:"하이 3",
    emotion:5,
    created_date: new Date().getTime()
  },
]

function App() {
  return (
    <div className="App">
      <DiaryEditor />
      <DiaryList diaryList={dumyList}/>
    </div>
  );
}

export default App;
